def count_trailing_zeros_in_factorial(n: int) -> int:
    if n <= 5:
        return 0
    power = 0
    divisors = []
    while True:
        divisor = 5 ** (power + 1)
        if n < divisor:
            break
        power += 1
        divisors.append(divisor)
    return sum((n // divisor for divisor in divisors))

